import React, { useState, useEffect } from 'react';
import { useSearchParams, useParams } from 'react-router-dom'; // Added useParams
import { supabase } from '@/lib/supabase';
import { Star } from 'lucide-react';
import '@/index.css';

const WallOfLove = () => {
  // CHANGE 1: Get spaceId from URL params instead of slug
  const { spaceId } = useParams(); 
  const [searchParams] = useSearchParams();

  const theme = searchParams.get('theme') || 'light';
  const layout = searchParams.get('layout') || 'grid';

  const [testimonials, setTestimonials] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (spaceId) {
      fetchTestimonials();
    }
  }, [spaceId]);

  const fetchTestimonials = async () => {
    try {
      // CHANGE 2: Simplified logic. 
      // We already have the spaceId, so we query testimonials directly.
      const { data, error } = await supabase
        .from('testimonials')
        .select('*')
        .eq('space_id', spaceId) // Use spaceId directly
        .eq('is_liked', true)
        .order('created_at', { ascending: false });

      if (error) throw error;
      setTestimonials(data || []);
    } catch (error) {
      console.error('Error fetching testimonials:', error);
    } finally {
      setLoading(false);
    }
  };

  // ... rest of the UI code (loading state, map loop, etc.) remains exactly the same
  // (Just copy the return statement from the previous version)

  if (loading) {
    // ... same loading UI
    return <div className="p-8">Loading...</div>; // Placeholder for brevity
  }

  if (testimonials.length === 0) {
    // ... same empty UI
    return <div className="p-8">No testimonials yet</div>;
  }

  return (
    <div className={`min-h-screen p-6 ${theme === 'dark' ? 'bg-gray-900' : 'bg-gray-50'}`}>
      <div className={`
        ${layout === 'masonry' ? 'block' : 'grid'} 
        gap-4 
        ${
          layout === 'carousel' 
            ? 'grid-flow-col auto-cols-[300px] overflow-x-auto pb-4' 
            : layout === 'masonry'
            ? 'columns-1 md:columns-2 lg:columns-3 space-y-4'
            : 'md:grid-cols-2 lg:grid-cols-3'
        }
      `}>
        {testimonials.map((testimonial) => (
          <div
            key={testimonial.id}
            className={`
              p-6 rounded-xl shadow-sm transition-all hover:shadow-md 
              ${theme === 'dark' ? 'bg-gray-800' : 'bg-white'} 
              ${layout === 'masonry' ? 'break-inside-avoid mb-4 inline-block w-full' : ''}
            `}
          >
            {/* Rating */}
            {testimonial.stars && ( 
              <div className="flex gap-0.5 mb-3">
                {[...Array(5)].map((_, i) => (
                  <Star
                    key={i}
                    className={`w-4 h-4 ${
                      i < testimonial.stars
                        ? 'fill-yellow-400 text-yellow-400'
                        : 'text-gray-300'
                    }`}
                  />
                ))}
              </div>
            )}

            {/* Content */}
            {testimonial.type === 'video' && testimonial.video_url ? (
              <video
                src={testimonial.video_url}
                controls
                className="w-full rounded-lg mb-4 aspect-video object-cover"
              />
            ) : (
              <p className={`text-sm mb-4 ${
                theme === 'dark' ? 'text-gray-200' : 'text-gray-700'
              }`}>
                "{testimonial.content}"
              </p>
            )}

            {/* Author */}
            <div className="flex items-center gap-3">
              <div className={`w-10 h-10 rounded-full flex items-center justify-center text-sm font-medium ${
                theme === 'dark' 
                  ? 'bg-violet-900/50 text-violet-300' 
                  : 'bg-violet-100 text-violet-600'
              }`}>
                {testimonial.name?.charAt(0).toUpperCase()}
              </div>
              <div>
                <div className={`font-medium text-sm ${
                  theme === 'dark' ? 'text-white' : 'text-gray-900'
                }`}>
                  {testimonial.name}
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default WallOfLove;
